import React , {useState} from "react";
import './YearFilter.css';
import LargeComponent from "../ItemsCollection/LargeComponent";
import Card from "../MainCard/Card";
const FilterYear = () => {
    return (
        <div>
            <div className="FilterCard">
                <Card>
                    <div className="Filter">
                        <label>Filter By Year</label>
                        <select onChange={OnFilterHandler}>
                            <option defaultValue >Choose a Year</option>
                            <option value='2019' >2019</option>
                            <option value='2020' >2020</option>
                            <option value='2021' >2021</option>
                            <option value='2022' >2022</option>
                        </select>
                    </div>
                </Card>
                <Card>
                    <LargeComponent items= {items} /*onExecute={ExectionHandler}*//>
                </Card>
            </div>
        </div>
    );
};
export default FilterYear;
